import React from 'react';
import styled from 'styled-components';

//Fields that can be updated.
// username: STRING, unique, max 100 chars
// password: STRING
// email: STRING, unique
// country: STRING [ 'Bolivia', 'Brazil', 'Cambodia', 'Colombia', 'Ecuador', 'El Salvador', 'Ghana', 'Guatemala', 'Haiti', 'Honduras', 'Kiribati', 'Madagascar', 'Mongolia', 'Nicaragua', 'Paraguay', 'Peru', 'Philippines', 'Sierra Leone', 'Zimbabwe' ]
// organization_title: STRING
const Form = styled.form`
  display: flex;
  flex-direction: column;
  width: 200px;
  margin: 0 auto;
`
const Background = styled.div`
  max-width: 1000px;
  background-color: #D1DAE5;
  margin: 0 auto;
`

class Profile extends React.Component{
  render(){
    return(
      <Background>
        <Form>
          <input palceholder='username' />
          <input palceholder='password' />
          <input palceholder='email' />
          <input palceholder='organization title' />
          <select>
            <option>
              Countries
            </option>
          </select>
        </Form>
      </Background>
    );
  }
}

export default Profile;
